    data: |
      SELECT col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT 98 / + - col0 BETWEEN - CAST ( - - CAST ( NULL AS INTEGER ) AS INTEGER ) AND - + col2;
  - name: tab1

outputs:
  - name: q12487.out
    data: |
      59
      68
      96
